import React, { Component } from 'react';
import './table.css';

class Table extends Component {

    renderTableData()
    {
        console.log(this.props.tab);
        return this.props.tab.map((tab, index) => {
            const { row, cleanedStatus, progress } = tab; //destructuring
            return (
                <tr key={row.i}>
                    <td>{row.i}</td>
                    <td>{cleanedStatus}</td>
                    <td>{progress}</td>
                </tr>
            )
        })
    }

    static renderTableHeader() {
            return (
                <tr>
                    <th>Row</th>
                    <th>Cleaned Status</th>
                    <th>Progress</th>
                </tr>
        )
    }

    render() {
        return (
            <div>
                <h1 id='title'>Row Info</h1>
                <table id='RvZ' className='table-responsive'>
                    <tbody>
                    {Table.renderTableHeader()}
                        {this.renderTableData()}
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Table;
